import Base64Binary from "./base64";

window.AudioContext = window.AudioContext || window.webkitAudioContext;
let myAudioContext = new AudioContext();
let mySource;
let audioPlaying = false;

function createAudioContext(desiredSampleRate) {
    const AudioCtor = window.AudioContext || window.webkitAudioContext;

    desiredSampleRate = typeof desiredSampleRate === "number" ?
        desiredSampleRate :
        44100;
    let context = new AudioCtor();

    // Check if hack is necessary. Only occurs in iOS6+ devices
    // and only when you first boot the iPhone, or play a audio/video
    // with a different sample rate
    if (
        /(iPhone|iPad)/i.test(navigator.userAgent) &&
        context.sampleRate !== desiredSampleRate
    ) {
        const buffer = context.createBuffer(1, 1, desiredSampleRate);
        const dummy = context.createBufferSource();
        dummy.buffer = buffer;
        dummy.connect(context.destination);
        dummy.start(0);
        dummy.disconnect();

        context.close(); // dispose old context
        context = new AudioCtor();
    }

    return context;
}

myAudioContext = createAudioContext(44100);

document.addEventListener("touchend", function(e) {
    myAudioContext = createAudioContext(44100);
});

// Possible words
export const words = [{
        word: "jeg",
        audio: ``
    }, {
        word: "er",
        audio: ``
    },
    {
        word: "en",
        audio: ``
    },
    {
        word: "et",
        audio: ``
    },
    {
        word: "lille",
        audio: ``
    },
    {
        word: "lille",
        audio: ``
    }
];


shuffle(words);

function shuffle(a) {
    var j, x, i;
    for (i = a.length - 1; i > 0; i--) {
        j = Math.floor(Math.random() * (i + 1));
        x = a[i];
        a[i] = a[j];
        a[j] = x;
    }
}



Object.keys(words).forEach((idx) => {
    let word = words[idx];
    let arrayBuff = Base64Binary.decodeArrayBuffer(word.audio);
    myAudioContext.decodeAudioData(arrayBuff, (audioData) => {
        words[idx].audio = audioData;
    });
});

export const play = (word, onEnd) => {
    try {
        mySource = myAudioContext.createBufferSource();
        mySource.buffer = word.audio;
        mySource.connect(myAudioContext.destination);
        audioPlaying = true;
        mySource.start(0);
        mySource.onended = function() {
            audioPlaying = false;
            if (onEnd)
                onEnd();
        };
    } catch (e) {
        console.log("Error playing audio" + e);
    }
};

export const stopSound = force => {
    if (mySource && (force || audioPlaying)) {
        try {
            mySource.stop(0);
            audioPlaying = false;
        } catch (e) {
            console.log("error stopping sound", e);
        }
    }
};